import React from 'react';
import { Card } from 'react-bootstrap';

class CurrentWeather extends React.PureComponent {
  render() {
    return (
      <Card>
          <Card.Body>
            {this.props}
          </Card.Body>
      </Card>
    );
  }
}

export default CurrentWeather;
